import React from "react";
import comercioIcon from "./img/i-comercio.webp";
import depIcon from "./img/i-dep.webp";
import eduIcon from "./img/i-edu.webp";
import guarIcon from "./img/i-guar.webp";
import infraIcon from "./img/i-infrasocial.webp";
import ppIcon from "./img/i-pp.webp";
import saludIcon from "./img/i-salud.webp";
import mercadoIcon from "./img/i-mercado.webp";
import pobIcon from "./img/i-p.webp";
import pobMaIcon from "./img/i-pm.webp";
import pobFeIcon from "./img/i-pf.webp";
import vivIcon from "./img/i-viv.webp";
import jefMaIcon from "./img/i-jm.webp";
import jefFeIcon from "./img/i-jf.webp";
import alumIcon from "./img/i-alum.webp";
import arbIcon from "./img/i-arb.webp";
import banqIcon from "./img/i-banq.webp";
import dreIcon from "./img/i-dre.webp";
import recIcon from "./img/i-rec.webp";

function AGEBInfo({ ageb, neighborhood }) {
  if (!ageb || !neighborhood) {
    return <div>No neighborhood or AGEB information available.</div>;
  }

  return (
    <div className="ageb-container">
      <div className="ageb-info">
        <div className="name">
          <h4>{neighborhood.display_name}</h4>
          <p className="cvegeo">CVEGEO: {ageb.properties.CVEGEO}</p>
        </div>

        <p>
          <img className="icon" src={saludIcon} alt="Salud Icon" /> Centros de
          Salud: {ageb.properties.salud_count}
        </p>

        <p>
          <img className="icon" src={eduIcon} alt="Educación Icon" /> Centros
          Educativos: {ageb.properties.educacion_count}
        </p>

        <p>
          <img className="icon" src={depIcon} alt="Deportivos Icon" /> Centros
          Deportivos: {ageb.properties.deportivos_count}
        </p>

        <p>
          <img
            className="icon"
            src={infraIcon}
            alt="Infraestructura Social Icon"
          />{" "}
          Infraestructura Social: {ageb.properties.infraestructura_count}
        </p>

        <p>
          <img className="icon" src={ppIcon} alt="Plazas Públicas Icon" />{" "}
          Plazas Públicas: {ageb.properties.pp_count}
        </p>

        <p>
          <img className="icon" src={guarIcon} alt="Guarderías Icon" />{" "}
          Guarderías: {ageb.properties.guarderias}
        </p>

        <p>
          <img className="icon" src={mercadoIcon} alt="Comercio Icon" />{" "}
          Mercados: {ageb.properties.comercios_count}
        </p>

        <p>
          <img className="icon" src={comercioIcon} alt="Abarrotes Icon" />{" "}
          Abarrotes: {ageb.properties.abarrotes}
        </p>
      </div>

      <div className="population-info">
        <h4 className="name">Población</h4>
        <div className="poblacion">
          <p>
            <img className="icon-pob" src={pobIcon} alt="Población Icon" />
            Total: {ageb.properties.POBTOT}
          </p>
          <p>
            <img
              className="icon-pob"
              src={pobFeIcon}
              alt="Población Femenina Icon"
            />
            {ageb.properties.POBFEM}
          </p>
          <p>
            <img
              className="icon-pob"
              src={pobMaIcon}
              alt="Población Masculina Icon"
            />
            {ageb.properties.POBMAS}
          </p>
        </div>
        <div className="viviendas">
          <p>
            <img className="icon-viv" src={vivIcon} alt="Viviendas Icon" />
            Total de Viviendas: {ageb.properties.VIVTOT}
          </p>
          <p>
            <img
              className="icon-viv"
              src={jefFeIcon}
              alt="Jefe de Familia Femenino Icon"
            />
            Jefe de familia femenino: {ageb.properties.HOGJEF_F}
          </p>
          <p>
            <img
              className="icon-viv"
              src={jefMaIcon}
              alt="Jefe de Familia Masculino Icon"
            />
            Jefe de familia femenino: {ageb.properties.HOGJEF_F}
          </p>
        </div>
      </div>

      <div className="infra-info">
        <h4 className="name">
          Establecimientos con infraestructura pública en los cuatro frentes
        </h4>
        <div className="infraestructura">
          <p>
            <img className="icon" src={alumIcon} alt="Alumbrado público Icon" />
            Alumbrado público: {ageb.properties.ALUMPUB}
          </p>
          <p>
            <img className="icon" src={arbIcon} alt="Árboles Icon" />
            Árboles: {ageb.properties.ARBOLES}
          </p>
          <p>
            <img className="icon" src={banqIcon} alt="Banqueta Icon" />
            Banqueta: {ageb.properties.BANQUETA}
          </p>
          <p>
            <img className="icon" src={dreIcon} alt="Drenaje Icon" />
            Drenaje: {ageb.properties.DRENAJEP}
          </p>
          <p>
            <img className="icon" src={recIcon} alt="recubrimiento Icon" />
            Recubrimiento: {ageb.properties.RECUCALL}
          </p>
        </div>
      </div>

      <div className="other-info">
        <h4 className="name">Other info goes here...</h4>
      </div>
    </div>
  );
}

export default AGEBInfo;
